import './index.css';
import './App.css';
import React, { Component } from "react";
import HeartCounter from "./HeartCounter";

export default class DisplayList extends Component {
    render() {
        return (
            <div>
                {this.props.list.map(piece =>
                    <div class="image_div">
                        <img src={piece.src} alt="blah" class="image" />
                        <div class="image_desc">
                            <div class="title_and_medium">
                                <h1>{piece.name}</h1>
                                <h1 class="medium">: {piece.medium}</h1>
                            </div>
                            <p>{piece.date}</p>
                            <h3>{piece.award}</h3>
                            <HeartCounter text="Give it Love!" />
                        </div>
                    </div>)
                }
            </div>
        )
    }

}
